import React from "react";
import { css, jsx } from "@emotion/react";

export const Slide = ({ content, num }) => (
  <div className='{`${num}`}'>
    <style>
      {`
      .${num} {
        height: 100px;
        width: 100px;
        background-image: url("${content}");
        background-size: cover;
        background-repeat: no-repeat;
        background-position: center;
      }
      `}
    </style>
  </div>
);
